webpackJsonp([2899013301966],{455:function(e,t){e.exports={data:{markdownRemark:{html:'<p>With Redmine integration, HackerOne makes it easy for you to track Redmine issues as references on HackerOne.</p>\n<p>In order to configure Redmine integration for you team, contact HackerOne with the following information:   </p>\n<li> The base URI of the Redmine instance (e.g., "https://redmine.company.com/")\n<li> The project (project_id) you’d like issues to default to (an integer)\n<li> The tracker (tracker_id) you’d like issues to default to (an integer)\n<li> Any other custom/specific fields you’d like prepopulated. Options are described here: http://www.redmine.org/projects/redmine/wiki/Rest_Issues#Creating-an-issue\n<p>With all of the provided information, HackerOne will be able to set up your requested integration. You’ll get an email notification letting you know that your integration has been set up within 1-2 business days.</p>\n<h3>How the Integration Works</h3>\n<p>After your Redmine integration has been set up:</p>\n<ol>\n<li>Change the action picker to <strong>Change state > Triaged</strong> in your report. </li>\n</ol>\n<p><img src="https://github.com/Hacker0x01/docs.hackerone.com/blob/master/docs/programs/images/integrations.png?raw=true" alt="integrations"></p>\n<ol start="2">\n<li>Click <strong>Escalate</strong>.</li>\n<li>You’ll be taken to your Redmine account where the report is pre-populated. Submit the issue to create the report in Redmine.</li>\n<li>Copy the Redmine report issue number and paste it in the <strong>Reference ID</strong> field of the HackerOne report to create a direct reference link to the issue in Redmine.  </li>\n</ol>',frontmatter:{path:"/programs/redmine-integration",title:"Redmine Integration"}}},pathContext:{}}}});
